import React, { useEffect, useRef } from 'react';
import SocketIOClient from 'socket.io';

const App = () => {
  const socket = useRef(null);

  useEffect(() => {
    socket.current = SocketIOClient();

    socket.current.on("connect", console.log);
  }, []);

  return null;
}

export default App;
